import React from "react";
import "./Image.css";

function Contact() {
  return (
    <div className="details">
      <br />
      <div id="card" className="card">
        <div id="card-title1" className="card-title">
          Contact Information
        </div>
        <div id="card-text" className="card-text">
          Hosahalli, Tumkur - Koratagere Road, Obalapura Post, Tumkur - 572 106
          <br />
          Mobile: 9900087891 / 9845474343
          <br />
          E-mail: vj_ak@yahoo.com
          <br />
          yogendratp@gmail.com
        </div>
      </div>
    </div>
  );
}

export default Contact;
